self.b64DecodeUnicode = function (str) {
  return decodeURIComponent(Array.prototype.map.call(atob(str), function (c) {
    var pos = 0, hex = 16, final = -2;
    return '%' + ('00' + c.charCodeAt(pos).toString(hex)).slice(final);
  }).join(''));
};

